/*Table structure for table `t_s_job` */

DROP TABLE IF EXISTS `t_s_job`;

CREATE TABLE `t_s_job` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `group` varchar(100) DEFAULT NULL COMMENT '分组',
  `status` varchar(50) DEFAULT '0' COMMENT '状态 0-运行,1-暂停，2-废止',
  `clazz` varchar(255) DEFAULT NULL COMMENT '实现类',
  `expression` varchar(200) NOT NULL COMMENT '表达式',
  `description` varchar(500) DEFAULT NULL COMMENT '说明',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

